import React from 'react';  
import {Component} from 'react';  
import './App.css';

const App = () => {
  return (
	<>
	<div className="App">
	  <ul>
		<li>html</li>
		<li>js</li>
		<li>css</li>
		<li>react</li>
	  </ul>
	</div>
	</> 
  );
}

export default App;
